import React from "react";
import styled from "styled-components";
import PTPose from "../img/PTPose.gif";

const SlideGroup = styled.div`
  display: flex;
`;

const SlideImg = styled.img`
  width: 300px;
`;

const SlideDesc = styled.div``;

const IMG = styled.img`
  width: 300px;
`;

const Slide = ({ img }) => {
  // return <IMG src={img} />;
  return (
    <SlideGroup>
      <SlideImg />
      <SlideDesc>
        인공지능 기술을 이용하여 사용자의 골격을 디텍션 하여 올바른 운동자세를
        안내합니다.
      </SlideDesc>
    </SlideGroup>
  );
};

export default Slide;
